CREATE TABLE `#__j2store_product_options` (   `product_option_id` int(11) NOT NULL AUTO_INCREMENT,   `product_id` int(11) NOT NULL,   `option_id` int(11) NOT NULL,   `option_value` varchar(255) NOT NULL,   `required` tinyint(1) NOT NULL,   PRIMARY KEY (`product_option_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_product_optionvalues` (   `product_optionvalue_id` int(11) NOT NULL AUTO_INCREMENT,   `product_option_id` int(11) NOT NULL,   `product_id` int(11) NOT NULL,   `option_id` int(11) NOT NULL,   `optionvalue_id` int(11) NOT NULL,   `product_optionvalue_price` decimal(11,3) NOT NULL,   `product_optionvalue_prefix` varchar(255) NOT NULL,   `product_optionvalue_weight` decimal(15,8) NOT NULL,   `product_optionvalue_weight_prefix` varchar(1) NOT NULL,   `product_optionvalue_sku` varchar(255) NOT NULL,   `product_optionvalue_default` varchar(255) NOT NULL,   `ordering` int(11) NOT NULL,   PRIMARY KEY (`product_optionvalue_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_productfiles` (   `productfile_id` int(11) NOT NULL AUTO_INCREMENT,   `product_file_display_name` varchar(255) NOT NULL,   `product_file_save_name` varchar(255) NOT NULL,   `purchase_required` tinyint(1) NOT NULL,   `state` tinyint(1) NOT NULL,   `download_limit` int(11) NOT NULL,   `product_id` int(11) NOT NULL,   `download_total` int(11) NOT NULL,   `ordering` int(11) NOT NULL,   PRIMARY KEY (`productfile_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_productprices` (   `productprice_id` int(11) NOT NULL AUTO_INCREMENT,   `product_id` int(11) NOT NULL,   `quantity_start` int(11) NOT NULL,   `condition` varchar(255) NOT NULL,   `quantity_end` int(11) NOT NULL,   `publish_up` datetime NOT NULL,   `publish_down` datetime NOT NULL,   `state` int(11) NOT NULL COMMENT 'publish or unpublish',   `price` decimal(12,3) NOT NULL,   `ordering` int(11) NOT NULL,   PRIMARY KEY (`productprice_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
